function sleep(t){return new Promise(e=>setTimeout(e,t))}window.onload=function(){applyEvents(),mutationObserver.observe(document.body,{attributes:!0,childList:!0,subtree:!0,attributeFilter:["href"]})};var current=[];function createPrefetch(){current.push(this.href),sleep(50).then(()=>{if(current.includes(this.href)){const e=document.createElement("link");e.id=this.href,e.href=this.href,e.rel="prefetch",document.getElementsByTagName("head")[0].appendChild(e)}})}function removePrefetch(){if(current.pop(this.href),null!=document.getElementById(this.href)){const e=document.getElementById(this.href);e.remove()}}var mutationObserver=new MutationObserver(function(e){e.forEach(function(e){applyEvents()})});function applyEvents(){document.querySelectorAll("a").forEach(e=>{e.addEventListener("mouseover",createPrefetch),e.addEventListener("mouseout",removePrefetch)})}